switch (MenuName) {
  // defines the top level menu option
  case "":
    return menuHeader;
  // defines the submenu options
  case menuHeader:
    string[] subMenus = { menuHello, menuGoodbye };
    return subMenus;
}

return "";

if (IsProjectOpen(Repository)) {
  switch (ItemName) {
    // define the state of the hello menu option
    case menuHello:
      IsEnabled = shouldWeSayHello;
      break;
    // define the state of the goodbye menu option
    case menuGoodbye:
      IsEnabled = !shouldWeSayHello;
      break;
    // there shouldn't be any other, but just in case disable it.
    default:
      IsEnabled = false;
      break;
  }
} else {
  // If no open project, disable all menu options
  IsEnabled = false;
}

switch (ItemName) {
  // user has clicked the menuHello menu option
  case menuHello:
    this.sayHello();
    break;
  // user has clicked the menuGoodbye menu option
  case menuGoodbye:
    this.sayGoodbye();
    break;
}

try {
  EA.Collection c = Repository.Models;
  return true;
} catch {
  return false;
}
